import styled, {keyframes, ThemeProvider} from 'styled-components';
import React from 'react';

const Eye = styled.div`
    margin: auto;
    width: 10px;
    height: 10px;
    background-color: #fff;
    overflow: hidden;
    border-radius: 50%;
`;

const CircleEye = () => {
    return (
        <Eye>
            <Pupile></Pupile>
        </Eye>
    );
};

export default CircleEye;
